import Layout from '../components/Layout'
import Me from '../static/images/IMG_0709.jpg'


class Home extends Component {
  render() {
    return (
        <Layout>

            <div className="container-fluid landing">
                <div className="centerLanding">
                    <h1>Alex Do</h1>
                    <h3>UW-Madison '21</h3>
                </div> 
            </div>
            <div className="container">
                <div className="row">
                    <div className="col portrait">
                        <img src={Me} alt="me"/>
                    </div>
                    <div className="col">
                        <h3>Hi, I'm Alex</h3>
                        <p> gdfgdfgdfgdfgdfgdfgdfgdfgdfgdfg
                            ofijweoifjweofjoiwefjwoeifjwieojfweoifjf
