                            wfoiwejfoiwejfoiwjfoiwejfoiwejfoiwefjowiefjoiwe
                            foiwejfoiwejfoiwejfowiejfawiofhdsiokljdfpogilakngp
                        </p>
                    </div>
                </div>
            </div>
            <div className="container-fluid">
                <div className="row">
                    <div className="col">
                        <h3>Java</h3>
                        <p>is the language I primarily use in my computer science courses</p>
                    </div>
                    <div className="col">
                        <h3>Python</h3>
                        <p>a fun language I&#39;m picking up. I use it for my research and for personal projects</p>
                    </div>
                </div>
                <div className="row">
                    <div className="col">
                        <h3>JavaScript</h3>
                        <p>currently learning it to develop this website; it has so much potential and is used everywhere</p>
                    </div>
                    <div className="col">
                        <h3>C/C++</h3>
                        <p>tougher language than most, but I want to get more into lower-level programming, so I will have to suck it up</p>
                    </div>
                </div>
            </div>




            <style jsx>{`
                .landing {
                    background-image: url(../static/images/IMG_1093.jpg);
                    height: 100vh;
                    background-size: cover;
                    background-position: center center;
                    background-repeat: no-repeat;
                    position: relative;
                  }

                  .centerLanding {
                    color: white;
                    position: absolute;
                    top: 50%;
                    left: 50%;
                    transform: translateX(-50%) translateY(-50%);

                  }

                  .aboutMe {
                    position: relative;
                    margin-top: 30px;
                    margin-bottom: 30px;
                  }

                  .portrait {

                    background-size: cover;
                    background-position: center center;
                    background-repeat: no-repeat;
                    border-radius: 50%;
                    height: 325px;
                    width: 75%;

                  }

                  .row {
                    padding: 50px;
                  }

                  .hello .col #js {
                    margin: 0;
                    margin-right: 0;
                    background-color: yellow;
                  }

                  .js {
                    background-color: yellow;
                  }
            `}</style>
        </Layout>
    );
  }
}

export default Home;
